  Box,
  Center,
  Heading,
  Text,
  Stack,
  Avatar,
  useColorModeValue,
  Image,
  Badge,
} from '@chakra-ui/react'

export default function AspectCardJalaine() {
  return (
    <Center py={6}>
      <Box
        maxW={'445px'}
        w={'full'}
        bg={useColorModeValue('white', 'gray.900')}
        boxShadow={'2xl'}
        rounded={'md'}
        p={6}
        overflow={'hidden'}
      >
        <Box
          h={'210px'}
          bg={'gray.100'}
          mt={-6}
          mx={-6}
          mb={-9}
          pos={'relative'}
        >
          <Image
            src={
              'https://www.thoughtco.com/thmb/p5bYEi69NpvArdAOSYv_udIcKvQ=/1939x1454/smart/filters:no_upscale()/Bonampak-feast-56a025d93df78cafdaa04c70.jpg'
            }
            layout={'fill'}
            maxHeight={'297px'}
            width={'full'}
          />
        </Box>
        <Stack mt={36}>
          <Text
            color={'primary'}
            textTransform={'uppercase'}
            fontWeight={800}
            fontSize={'sm'}
            letterSpacing={1.1}
          >
            Learning Tool
          </Text>
          <Stack direction='row'>
            <Badge
              borderRadius='full'
              px='2'
              colorScheme='orange'
              variant='subtle'
            >
              Social Structure
